INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 1, 1, 'und', 0, 'The Rei dummy system is implied to be beset with problems. Nerv successfully uses it only once, when Gendo has it seize control of Eva-01 from Shinji in Episode 18. In Episode 19, Eva-01 rejects both Rei and the Rei dummy plug, accepting only Shinji as its pilot. Never again is any attempt made to use the dummy plug with Eva-01. A dummy system was installed on Eva-02 and the required data transferred as well, but no attempt was ever made to utilize it.\r\n\r\n', '', 'filtered_html'),
('node', 'company', 0, 2, 2, 'und', 0, '<h3>Company Policy </h3> <img src=\"/employe/sites/default/files/image-2017-02-10-2_0.png\" alt=\"logo\">\r\n', '', 'full_html'),
('node', 'post_news', 0, 4, 4, 'und', 0, 'Dear All,\r\n\r\nThis time we forgot to issue the paid leave for Nov to you all, so it will be surely added into next month salary.\r\n\r\nThanks and Regards,\r\n\r\nMs.Ashvita Jaiswal\r\nHR Manager\r\nNewTechFusion Cybertech Pvt Ltd.', '', 'filtered_html'),
('node', 'post_news', 0, 5, 5, 'und', 0, 'Dear All,\r\n\r\nThis is to inform you all that  we are taking the serious changes regarding the leave policy effective from today itself, which we expect each and every employee to be strictly following.\r\n\r\nThe change would impact to  the people who is usually taking frequent adhoc leaves. We are imposing this because of so many adhoc leaves and unprofessional behavior, the company is facing serious work/financial losses.\r\n\r\nIt also impact negative effect to the company policy and company image as we are loosing our clients due to lack of work done on respective time from our side.\r\n\r\nTake a following  serious note:\r\n\r\n1. For Adhoc Leave- If in case any employee takes leave near Weekend or any other Holiday considering that 4th Saturday, Sundays or any holiday will not be countable, it is inform all that it will be counted as leave.(including Sunday)\r\n\r\nFor example:\r\n\r\nIf someone has taken three days leave from 22/02/2017 to 24/02/2017, which includes 4th Saturday(25/02/2017), Sunday and return to office on 27/02/2017 considering 26/02/2017 is Holiday(Sunday). Here, instead of counting 3 days leave I will be counting 5 days leave (22/02/2017- 26/02/2017).\r\n\r\n2. If in case any employee takes more then 2 leaves in a month then it will not be cover up by your full paid leave as you takes more number of leave you will get less than one paid leave.\r\nJust for clarification to earn one paid leave you have to work for at least 24 days in a month otherwise it will be count as less then one paid leave. \r\n\r\nFor example:\r\n\r\nIf someone has taken 5 leaves in a month and if he thinks that he is getting one paid leave from the company and count the number of leave only 4 than it usually not counted  in that way. He will be paid by less than one paid leave according to calculation.\r\n\r\n3. Everyone need to reduce taking consecutive adhoc leave.\r\n\r\n4. If your leave is not approved and still you do not come to office (due to any xyz urgent reason) then adhoc leave will be imposed on the working days on which you are absent.\r\n\r\nMeaning of Adhoc  leave - Intimation/information of leave will give on the same day or a day prior from the day of leave would be considered as Adhoc leave.\r\n\r\nIntimation/information of leave will give before 2 (working days) from the day of leave would be considered as NON-Adhoc leave. We recommend to apply for leave in HRM atleast 8 days before but we will consider until two days prior. \r\n\r\n\r\n It will be inform you all on a serious note that:\r\n\r\n* Management will be discussing with the concerned Team Lead before considering the adhoc leave.\r\n\r\n *Unless the reason is strong, adhoc leave will not be considered. \r\n\r\n* Filling up Leave Form is important as well applying through Orange HRM or please email to hr@newtechfusion.com.\r\n \r\n* Leave form will be available at HR Desk.\r\n\r\nIt is mandatory, you have to apply for the leave at least before 2 working day, Once you apply for leave , it is your responsibility to get the leave approved by your team Leader and inform me the same. It will not considerable any call or mail on the same day of leave.\r\n\r\n\r\nP.S.- The team leader will have the right to approve or reject leaves.\r\n\r\nThese terms and condition should be follow from today by all the employee.\r\n-- \r\nThanks and Regards,\r\n\r\nMs.Ashvita Jaiswal\r\nHR Manager\r\nNewTechFusion Cybertech Pvt Ltd.\r\n', '', 'filtered_html'),
('node', 'post_news', 0, 6, 6, 'und', 0, 'Dear All,\r\n\r\nIt has been observed by the Management since long that while using washroom usually people are not flush it. \r\n\r\nOn a friendly note, I am expecting that everybody must be flushed the washroom once you used. \r\n\r\nI hope that all you guys will be take care of this from today itself, so that I don\'t need to remind you all for the same in the future.\r\n\r\nThanks and Regards,\r\n\r\nMs.Ashvita Jaiswal\r\nHR Manager\r\nNewTechFusion Cybertech Pvt Ltd.\r\nwww.newtechfusion.com\r\n102 Press House,\r\n22 Press Complex,\r\nBesides Lokswami Press,\r\nAB Road Indore\r\nPhn - 0731-4050926', '', 'filtered_html');
