INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(1, 'node', ' about us the rei dummy system is implied to be beset with problems nerv successfully uses it only once when gendo has it seize control of eva01 from shinji in episode 18 in episode 19 eva01 rejects both rei and the rei dummy plug accepting only shinji as its pilot never again is any attempt made to use the dummy plug with eva01 a dummy system was installed on eva02 and the required data transferred as well but no attempt was ever made to utilize it skills php year of experience 1 year  ', 0),
(2, 'node', ' company policy company policy thumbnails document outline search document find toggle sidebar previous next page fullscreen print download current view zoom out zoom in automatic zoom actual size fit page full width 50 75 100 125 150 200 more information less information close click here to download the pdf file ', 0),
(4, 'node', ' paid leave of last month dear all this time we forgot to issue the paid leave for nov to you all so it will be surely added into next month salary thanks and regards msashvita jaiswal hr manager newtechfusion cybertech pvt ltd omrmankar mon 2132017 1253 permalink thank you thank you 1 log in or register to post comments admin mon 2132017 1524 permalink welcome welcome log in or register to post comments  ', 0),
(5, 'node', ' important leave policy alteration dear all this is to inform you all that we are taking the serious changes regarding the leave policy effective from today itself which we expect each and every employee to be strictly following the change would impact to the people who is usually taking frequent adhoc leaves we are imposing this because of so many adhoc leaves and unprofessional behavior the company is facing serious work financial losses it also impact negative effect to the company policy and company image as we are loosing our clients due to lack of work done on respective time from our side take a following serious note 1 for adhoc leave if in case any employee takes leave near weekend or any other holiday considering that 4th saturday sundays or any holiday will not be countable it is inform all that it will be counted as leave including sunday for example if someone has taken three days leave from 22022017 to 24022017 which includes 4th saturday 25022017 sunday and return to office on 27022017 considering 26022017 is holiday sunday here instead of counting 3 days leave i will be counting 5 days leave 22022017 26022017 2 if in case any employee takes more then 2 leaves in a month then it will not be cover up by your full paid leave as you takes more number of leave you will get less than one paid leave just for clarification to earn one paid leave you have to work for at least 24 days in a month otherwise it will be count as less then one paid leave for example if someone has taken 5 leaves in a month and if he thinks that he is getting one paid leave from the company and count the number of leave only 4 than it usually not counted in that way he will be paid by less than one paid leave according to calculation 3 everyone need to reduce taking consecutive adhoc leave 4 if your leave is not approved and still you do not come to office due to any xyz urgent reason then adhoc leave will be imposed on the working days on which you are absent meaning of adhoc leave intimation information of leave will give on the same day or a day prior from the day of leave would be considered as adhoc leave intimation information of leave will give before 2 working days from the day of leave would be considered as nonadhoc leave we recommend to apply for leave in hrm atleast 8 days before but we will consider until two days prior it will be inform you all on a serious note that management will be discussing with the concerned team lead before considering the adhoc leave unless the reason is strong adhoc leave will not be considered filling up leave form is important as well applying through orange hrm or please email to hr newtechfusioncom  leave form will be available at hr desk it is mandatory you have to apply for the leave at least before 2 working day once you apply for leave it is your responsibility to get the leave approved by your team leader and inform me the same it will not considerable any call or mail on the same day of leave ps the team leader will have the right to approve or reject leaves these terms and condition should be follow from today by all the employee thanks and regards msashvita jaiswal hr manager newtechfusion cybertech pvt ltd  ', 0),
(6, 'node', ' reminder for all dear all it has been observed by the management since long that while using washroom usually people are not flush it on a friendly note i am expecting that everybody must be flushed the washroom once you used i hope that all you guys will be take care of this from today itself so that i don t need to remind you all for the same in the future thanks and regards msashvita jaiswal hr manager newtechfusion cybertech pvt ltd wwwnewtechfusioncom 102 press house 22 press complex besides lokswami press ab road indore phn 7314050926  ', 0);
